import React from 'react'
import Button from "./Button";

export default class Footer extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        return (
            <div className={"flex-center space-around calculated-margins bgd-black"}
                 style={{alignItems:"baseline"}}>
                <div className={"flex-center"}>
                    <input
                    type={"email"}
                    className={"white-border bgd-black"}/>
                    <Button text={"Sign Up"}
                    class={"bgd-white"}/>
                    placeholder={"Email Address"}
                </div>
            </div>
        )
    }
}
